// src/App.js
import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import Navbar from './components/layout/Navbar';
import AppRouter from './routes/AppRouter';

function App() {
  return (
    <BrowserRouter>
      <div className="app">
        <Navbar />
        <main className="main-content">
          <AppRouter />
        </main>
      </div>
    </BrowserRouter>
  );
}

export default App;
